                    productsTillNow[mf_adrr].pop();
                    carTags[carTagsIdx++] = newcar.tag;
                }
                transferMoney(
                    manufacturers[manufacturerID].wallet,
                    effective_price
                );
                transferMoney(
                    customers[
                        purchasesTillNow[manufacturers[manufacturerID].wallet][
